import React, { useState, useEffect } from 'react';
import { MapContainer, TileLayer, Marker, Popup, Circle, useMap } from 'react-leaflet';
import L from 'leaflet';
import 'leaflet/dist/leaflet.css';
import drone from '../images/drone.png';

export default function Map() {
    const [location, setLocation] = useState(null);
    const [userLocation, setUserLocation] = useState(null);
    const [error, setError] = useState(null);
    const [markers, setMarkers] = useState([]); // State to store multiple markers

    useEffect(() => {
        // Check if geolocation is available in the browser
        if (navigator.geolocation) {
            navigator.geolocation.getCurrentPosition(
                (position) => {
                    const { latitude, longitude } = position.coords;
                    setLocation({ latitude, longitude });
                    setUserLocation([latitude, longitude]);  // Set the user location
                },
                (error) => {
                    setError(error.message);
                }
            );
        } else {
            setError('Geolocation is not supported by this browser.');
        }
    }, []);

    // Handle map click event to add markers
    const handleMapClick = (event) => {
        const { lat, lng } = event.latlng;
        console.log('Map clicked at:', lat, lng); // Debug log to check if the event is being fired
        setMarkers((prevMarkers) => [...prevMarkers, { lat, lng }]); // Add new marker to state
    };

    const markerIcon = new L.Icon({
        iconUrl: drone,  // Use the imported image as the icon URL
        iconSize: [32, 32],  // Customize the size of the icon
        iconAnchor: [16, 32],  // Anchor point of the icon
        popupAnchor: [0, -32],  // Popup anchor point
    });

    // Custom Button Control
    const CustomButton = () => {
        const map = useMap();  // Access the map instance
        useEffect(() => {
            const buttonControl = L.control({ position: 'topright' }); // Position the button at the top-right

            buttonControl.onAdd = function () {
                const button = L.DomUtil.create('button', 'leaflet-bar');
                button.innerHTML = 'Add waypoint';  // Button text
                button.style.backgroundColor = '#0078AA'; // Button color
                button.style.color = '#fff';  // Text color
                button.style.padding = '10px';
                button.style.borderRadius = '5px';
                button.style.border = 'none';
                button.style.cursor = 'pointer';

                // Add an event listener to the button to handle clicks
                button.onclick = () => {
                    alert('Button clicked!');
                    // You can add any functionality here, e.g., zoomIn, add markers, etc.
                    //map.setView([51.505, -0.09], 13); // Example of changing the map view
                };

                return button;
            };

            buttonControl.addTo(map);  // Add the button to the map
            return () => {
                buttonControl.remove(); // Cleanup on component unmount
            };
        }, [userLocation]);

        return null;
    };

    return (
        <div>
            {
                userLocation ?
                    <MapContainer
                        style={{ height: "500px", width: "100%" }}
                        center={userLocation}
                        zoom={13}
                        scrollWheelZoom={false}
                        onClick={handleMapClick}
                    >
                        <TileLayer
                            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
                            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
                        />

                        <Marker position={userLocation} icon={markerIcon}>
                            <Popup>
                                Your Current location
                            </Popup>
                        </Marker>

                        {markers.map((marker, index) => (
                            <Marker key={index} position={[marker.lat, marker.lng]} icon={markerIcon}>
                                <Popup>
                                    A new marker at {marker.lat}, {marker.lng}
                                </Popup>
                            </Marker>
                        ))}

                        <Circle center={userLocation} radius={1609.34} color="blue" fillColor="blue" fillOpacity={0.2} />

                        <CustomButton />
                    </MapContainer>
                    :
                    <p>Loading user location...</p>
            }
        </div>
    );
}


